#include <unordered_set>

int mysterious_function(int arr[], int size) {
    std::unordered_set<int> set;
    for (int i = 0; i < size; i++) {
        if (set.find(arr[i]) != set.end()) {
            return arr[i];
        }
        set.insert(arr[i]);
    }
    return -1;
}

int main() {
    // Test case
    int arr[] = {2, 1, 5, 4, 2, 3};
    int size = sizeof(arr) / sizeof(arr[0]);
    std::cout << "First duplicate: " << mysterious_function(arr, size) << std::endl;
    return 0;
}",
